import React from 'react';
import CharacterCard from './CharacterCard'

const CharacterList = (props) => {
  const studentArray = props.students.map(student => <CharacterCard key={student._id} changeStudentInfo={props.changeStudentInfo} handleClick={props.handleClick} student={student}/>)
  return (
    <div id="character-list">
      {studentArray}
    </div>
  )
}

export default CharacterList;
